import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

export default function Redirect({ to }: any) {
    const navigate = useNavigate();
    useEffect(() => {
        navigate(to, { replace: true })
        // eslint-disable-next-line
    }, [])
    return null;
}
